description:
Kraków, sobota, 28 stycznia, godzina 10. Ruszyłeś na otwarcie KOMPANY. Wpadłeś na Berka Joselewicza 21. Byłeś. Krążyłeś miedzy piętrami. Zapuściłeś się w strefę dizajnu, foto, komiksu, architektury... Konsultowałeś własne projekty i pomysły, czerpałeś inspirację, wziałeś udział w warsztatach... Po drodze smak i łyk. Wybiła 21. 

W sąsiadujących Literkach imprezę rozkręcili ENVEE i Animisiewasz Startt. KO-lorowałeś ściany, chwytałeś przekąskę, regenerowałeś się kawą. Łapałeś dobre kontakty, bawiłeś się, uśmiechałeś się do nowych znajomych. Trzymałeś nogi na pufie, głowę w chmurach. 

Nawet się nie zorientowałeś, że już niedziela, 29 stycznia, godzina 10. Spędziłeś z nami 24 godziny. Razem otworzyliśmy KOMPANY, razem stworzyliśmy przestrzeń dla freelancerów, przedsiębiorców, wolnych umysłów.

Tak było! STARTINGOOD KOMPANY

/ więcej na: http://kompany.pl/306/startingood-kompany
___

